import React from "react";
import './style.scss'

var userData = JSON.parse(localStorage.getItem('user'));
export const ProfilePage = () => {
  return (
    <div className="profilePage">
        <h1>Welcome, <span>{userData.user_name}</span></h1>
        <p>{userData.user_name} | {userData.user_phone} | {userData.user_pass}</p>
    </div>    
  );
};
